import React from "react";
import { ExpandMore } from "@mui/icons-material";
import {
  Accordion,
  AccordionDetails,
  AccordionSummary,
  Typography,
} from "@mui/material";

export default function Group({ group }) {
  return (
    <Accordion expandIcon={<ExpandMore />}>
      <AccordionSummary>{group.name}</AccordionSummary>
      <AccordionDetails>
        <Typography variant="h3" align="center">
          {group.count[group.next - 1]}
        </Typography>
      </AccordionDetails>
    </Accordion>
  );
}
